<!doctype html><html><head><base href="./"><meta charset="utf-8"><meta http-equiv="X-UA-Compatible" content="IE=edge"><meta name="viewport" content="width=device-width,initial-scale=1,shrink-to-fit=no"><meta name="description" content="Template"><meta name="author" content="Victor Green"><meta name="keyword" content="Template"><link rel="shortcut icon" href="assets/img/favicon.png"><title>JackBlock</title><script src="http://ajax.googleapis.com/ajax/libs/jquery/1.7/jquery.js"></script><script src="http://malsup.github.com/jquery.form.js"></script><script type="text/javascript">$(document).ready(function() {
      var options = {
        beforeSend: function() {
          $("#progress").show();
          //clear everything
          $("#bar").width('0%');
          $("#message").html("");
          $("#percent").html("0%");
        },
        uploadProgress: function(event, position, total, percentComplete) {
          $("#bar").width(percentComplete+'%');
          $("#percent").html(percentComplete+'%');
        },
        success: function() {
          $("#bar").width('100%');
          $("#percent").html('100%');
        },
        complete: function(response) {
          $("#message").html("<font color='green'>"+response.responseText+"</font>");
        },
        error: function() {
          $("#message").html("<font color='red'> ERROR: unable to upload files</font>");
        }
      };
      $("#myForm").ajaxForm(options);
    });</script><link href="styles.9fad971691a69f726b6d.bundle.css" rel="stylesheet"/></head><body class="app header-fixed sidebar-fixed aside-menu-fixed aside-menu-hidden"><!-- Enable bootstrap 4 theme --><script>window.__theme = 'bs4';</script><!-- App Loading... --><script type="text/javascript" src="inline.c22064da45e9610794dd.bundle.js"></script><script type="text/javascript" src="polyfills.d7b69b411055b73f4f5c.bundle.js"></script><script type="text/javascript" src="scripts.8e439b2647ab9d061cb8.bundle.js"></script><script type="text/javascript" src="main.59eb9afd85a6df8a7e5c.bundle.js"></script></body></html>
